import { useSelector } from 'react-redux';
import styled from 'styled-components';


export default function Paginator() {
  const { pages } = useSelector(state => state)
  return (
    <Div> 
      { pages.map((page, index) => {
        return (<div>{ index }</div>);
      }) } 
    </Div>
  )
};

const Div = styled.div`
  position: absolute;
  left: 0px;
  top 200px;
`
